import React, { useEffect, useState } from 'react'
import Card from '../Card/Card';

const RankedData = () => {
    const [data,setData]=useState([]);

    useEffect(()=>{
        fetch("http://localhost:3000/api/olx").then(res=>res.json()).then(info=>setData(info));
    },[])

  return (
    <div>
        {/* <Card/> */}
    {data.map(({price,details,title,subtitle,img}, index) => {
      return <Card price={price} details={details} title={title} subtitle={subtitle} img={img}  key={index} />;
    })}
  </div>
  )
}

export default RankedData
